$$\frac{1}{2} |(x_1y_2 + x_2y_3 + x_3y_1) - (x_2y_1 + x_3y_2 + x_1y_3)|$$

We can apply this formula to the given points $P$, $Q$, and $R$ to calculate the area of the triangle.

```octave
