Given the equation $\tan^{-1} \left( \frac{1}{x} - \frac{x}{8} \right) + \tan^{-1}(ax) + \tan^{-1}(bx) = \frac{\pi}{2}$, we can rewrite it as $\tan^{-1}(\frac{1}{x} - \frac{x}{8}) + \tan^{-1}(ax) + \tan^{-1}(bx) = \tan^{-1}(\infty)$. Since $\tan^{-1}(\infty) = \frac{\pi}{2}$, we have $\tan^{-1}(\frac{1}{x} - \frac{x}{8}) + \tan^{-1}(ax) + \tan^{-1}(bx) = \frac{\pi}{2}$.

By the property of inverse tangent function, we can rewrite the left side of the equation as $\tan^{-1}(\frac{\frac{1}{x} - \frac{x}{8} + ax + bx}{1 - (\frac{1}{x} - \frac{x}{8})(ax + bx)})$.

Setting this equal to $\frac{\pi}{2}$, we get $\frac{\frac{1}{x} - \frac{x}{8} + ax + bx}{1 - (\frac{1}{x} - \frac{x}{8})(ax + bx)} = \infty$.

Solving this equation for $a$ and $b$, we can find the values of $a^2 + b^2$.

Here's a sample Octave code to solve this problem:

```octave
function result = solve_for_ab()
  syms x a b
  equation = ((1/x - x/8 + a*x + b*x) / (1 - (1/x - x/8) * (a*x + b*x))) == Inf;
  solution = solve(equation, [a, b]);
  result = solution{1}(1)^2 + solution{1}(2)^2;
end

result = solve_for_ab();
disp(result);
```

This code will output the value of $a^2 + b^2$.

