This problem can be solved programmatically using GNU Octave. Let's denote the initial number of blue marbles as B and the initial number of yellow marbles as Y. We know that the ratio of blue marbles to yellow marbles is 4:3, so we can write the equation: B/Y = 4/3. We also know that if we add 5 blue marbles and remove 3 yellow marbles, the ratio will be 7:3, so we can write the equation: (B+5)/(Y-3) = 7/3. We can solve these two equations simultaneously to find the values of B and Y.

```octave
function solve_marble_problem
  % Define the equations
  eq1 = @(B, Y) B/Y - 4/3;
  eq2 = @(B, Y) (B+5)/(Y-3) - 7/3;

  % Define the initial guess for the solver
  B0 = 1;
  Y0 = 1;

  % Solve the system of equations
  [B, Y] = fsolve([eq1, eq2], [B0, Y0]);

  % Print the result
  disp([B, Y]);
end

solve_marble_problem()
```
