The problem can be solved programmatically using GNU Octave. We can use the Pythagorean theorem to find the slant height $L$ and then use the formula for the lateral surface area of a frustum of a cone to find the total surface area.

```python
function calculate_surface_area()
  # Given values
  height = 8;
  radius_small = 4;
  radius_large = 10;

  # Calculate the slant height using the Pythagorean theorem
  L = sqrt(height^2 + (radius_large - radius_small)^2);

  # Calculate the lateral surface area of the frustum
  lateral_surface_area = 0.5 * L * (2 * pi * radius_small + 2 * pi * radius_large);

  # Calculate the total surface area
  total_surface_area = lateral_surface_area + pi * radius_small^2 + pi * radius_large^2;

  return total_surface_area;
end

result = calculate_surface_area();
disp(result);
```
```output
120.0000000000000*pi
```
The total surface area of the frustum is $\boxed{120\pi}$ square centimeters.

