This problem can be solved programmatically using GNU Octave. The function $k(x)$ is the inverse of $f(x)$, so we need to find a function $k(x)$ such that $f(k(x)) = x$ for all $x$ in the domain of $f$. 

We can set up the equation $f(k(x)) = x$ and solve for $k(x)$. 

For $x > 3$, we have $f(x) = k(x)$, so $k(k(x)) = x$. 

For $x \leq 3$, we have $f(x) = x^2 - 6x + 12$, so $(x^2 - 6x + 12)^2 - 6(x^2 - 6x + 12) + 12 = x$.

We can solve these equations using `fsolve` in GNU Octave.

```octave
function k = inverse_function()
    x = linspace(0, 10, 1000);
    k1 = fsolve(@(k) k - x, x(x > 3));
    k2 = fsolve(@(k) (k^2 - 6*k + 12)^2 - 6*(k^2 - 6*k + 12) + 12 - x, x(x <= 3));
    k = [k1, k2];
end

k = inverse_function();
```

This code defines a function `inverse_function` that finds the inverse of the function $f(x)$ and returns the function $k(x)$. The function `fsolve` is used to find the roots of the equations $k(k(x)) = x$ and $(x^2 - 6x + 12)^2 - 6(x^2 - 6x + 12) + 12 = x$. The solutions are stored in the variable `k` and returned.

