This problem can be solved programmatically using GNU Octave. We can use the built-in function `divisors` to find all the divisors of 252, and then filter out the even divisors.

```octave
function even_divisors_count
  # Get all divisors of 252
  divisors = divisors(252);

  # Filter out the even divisors
  even_divisors = divisors(divisors(end:-1:1) == 2);

  # Count the number of even divisors
  count = length(even_divisors);

  return count;
end

result = even_divisors_count();
print(result);
```
