We can calculate the probability as follows:

1. Calculate the total number of ways to select 5 CDs out of 12, which is $\binom{12}{5}$.
2. Calculate the number of ways to select 5 CDs with no restrictions, which is $\binom{12}{5}$.
3. Calculate the number of ways to select 5 CDs with at least one CD from each category. This can be done by considering the complementary probability, i.e., the probability of selecting 5 CDs with no CDs from a particular category. This can be calculated as $\binom{4}{0}\binom{5}{5}\binom{3}{5}$ for the rap music category, $\binom{4}{5}\binom{5}{0}\binom{3}{5}$ for the country music category, and $\binom{4}{5}\binom{5}{5}\binom{3}{0}$ for the heavy metal music category. The sum of these three probabilities gives the desired probability.

Let's calculate these probabilities using GNU Octave:

```octave
function calculate_probability()
    total_cds = 12;
    num_cds_to_choose = 5;

    % Calculate the total number of ways to select 5 CDs out of 12
    total_ways = nchoosek(total_cds, num_cds_to_choose);

    % Calculate the number of ways to select 5 CDs with no restrictions
    no_restrictions_ways = nchoosek(total_cds, num_cds_to_choose);

    % Calculate the number of ways to select 5 CDs with at least one CD from each category
    rap_music_ways = nchoosek(4, 0) * nchoosek(5, 5) * nchoosek(3, 5);
    country_music_ways = nchoosek(4, 5) * nchoosek(5, 0) * nchoosek(3, 5);
    heavy_metal_music_ways = nchoosek(4, 5) * nchoosek(5, 5) * nchoosek(3, 0);

    % Calculate the probability
    probability = 1 - (rap_music_ways + country_music_ways + heavy_metal_music_ways) / total_ways;

    % Convert the probability to a fraction
    [numerator, denominator] = rat(probability);

    return numerator, denominator;
end

