Here is a sample Octave code to solve this problem:

```octave
function lines_count
    S = [
        [-1,-1],
        [-1,0],
        [-1,1],
        [0,-1],
        [0,0],
        [0,1],
        [1,-1],
        [1,0],
        [1,1]
    ];

    lines = 0;

    for i = 1:length(S)
        for j = i+1:length(S)
            x1 = S(i,1);
            y1 = S(i,2);
            x2 = S(j,1);
            y2 = S(j,2);

            if (x1 == x2) || (y1 == y2)
                lines++;
            end
        end
    end

    lines = lines / 2;
    lines = lines + length(S);

    return lines;
end

result = lines_count();
disp(result);
```

This code iterates through all possible pairs of points in the set S and checks if the line passing through them has a slope of 0 or 1. If it does, it increments the count of lines. After iterating through all pairs, it divides the count by 2 to avoid double-counting the lines, and then adds the count to the total number of lines.

The result is the number of distinct lines that pass through at least two members of the set S.

