Here is a GNU Octave script to calculate the shortest distance:

```octave
function shortest_distance
  a_norm = 2;
  b_norm = 3;
  c_cross_a_norm = b_norm;
  c_norm = c_cross_a_norm / a_norm;
  theta = 90 * pi / 180;
  shortest_distance = c_norm * cos(theta);
  disp(shortest_distance);
end

shortest_distance()
```
