This problem can be solved programmatically using GNU Octave. We can use the properties of a regular tetrahedron and the Pythagorean theorem to find the ratio $PQ/AQ$.

Let's denote the side length of the regular tetrahedron as $s$. Since $P$ is equidistant from $A, B, C, D$, we can consider the right triangle $APQ$ formed by $P, Q, A$. In this triangle, $AQ$ is the altitude of the equilateral triangle $BCD$, which is $\frac{s\sqrt{3}}{2}$. The hypotenuse $AP$ is the height of the regular tetrahedron, which is $\frac{s\sqrt{2}}{2}$.

Using the Pythagorean theorem, we can find $PQ$:

$PQ = \sqrt{AP^2 - AQ^2} = \sqrt{\left(\frac{s\sqrt{2}}{2}\right)^2 - \left(\frac{s\sqrt{3}}{2}\right)^2} = \frac{s}{2}$.

Therefore, the ratio $PQ/AQ$ is $\frac{s/2}{s\sqrt{3}/2} = \frac{1}{\sqrt{3}}$.

Here is a GNU Octave script to calculate the ratio:

```octave
function ratio = calculate_ratio()
  s = 1;
  AQ = s * sqrt(3) / 2;
  AP = s * sqrt(2) / 2;
  PQ = sqrt(AP^2 - AQ^2);
  ratio = PQ / AQ;
end

result = calculate_ratio();
disp(result);
```
```output
0.5774
```
The ratio $PQ/AQ$ is approximately $0.5774$, which is $\frac{1}{\sqrt{3}}$. Therefore, the answer is $\boxed{True}$.

