This problem can be solved programmatically using GNU Octave. We can use the factorial function and the prime number function in Octave to solve this problem.

First, we calculate the quantity $0! + (1!) \times 1 + (2!) \times 2 + (3!) \times 3 + \cdots + (50!) \times 50$.

Then, we find the prime factors of the result.

Finally, we find the largest prime factor.

Here is the Octave code to solve this problem:

```octave
function largest_prime_factor
    total = 0;
    for i = 0:50
        total += factorial(i) * i;
    end

    prime_factors = factorint(total);
    largest_prime_factor = max(prime_factors);

    disp(largest_prime_factor);
end

largest_prime_factor = largest_prime_factor();
```

This code will output the largest prime number that divides the given quantity.

