This problem can be solved programmatically using GNU Octave. We can set up a system of linear congruences and solve it using the Chinese Remainder Theorem.

Let's denote the number of planets as $n$. We have the following system of congruences:

1. $n \equiv 6 \pmod{13}$
2. $n \equiv 5 \pmod{14}$

We can solve this system using the Chinese Remainder Theorem. The theorem states that if we have a system of linear congruences:

1. $x \equiv a_1 \pmod{m_1}$
2. $x \equiv a_2 \pmod{m_2}$

where $m_1$ and $m_2$ are coprime (i.e., their greatest common divisor is 1), then there exists a unique solution modulo $m_1m_2$.

In our case, $m_1 = 13$ and $m_2 = 14$ are coprime, so we can apply the Chinese Remainder Theorem. The solution is given by:

$n \equiv a_1M_1y_1 + a_2M_2y_2 \pmod{m_1m_2}$

where $M_1 = m_2 = 14$, $M_2 = m_1 = 13$, $y_1$ is the inverse of $M_1$ modulo $m_1$, and $y_2$ is the inverse of $M_2$ modulo $m_2$.

We can find $y_1$ and $y_2$ using the extended Euclidean algorithm. After calculating, we get $y_1 = 3$ and $y_2 = 2$.

Substituting these values into the formula, we get:

$n \equiv 6 \cdot 14 \cdot 3 + 5 \cdot 13 \cdot 2 \pmod{182}$

Calculating this expression, we find that $n \equiv 252 \pmod{182}$.

Since we are looking for the smallest positive solution, we can add multiples of 182 to 252 until we get a number greater than 100. After doing this, we find that the smallest number of planets that satisfies the conditions is $n = 252 + 182 = 434$.

Therefore, the answer is $\boxed{True}$.

Here is a GNU Octave script that solves the problem:

```octave
function smallest_planets
    % Define the congruences
    a1 = 6;
    m1 = 13;
    a2 = 5;
    m2 = 14;

    % Calculate M1, M2, y1, and y2
    M1 = m2;
    M2 = m1;
    y1 = mod_inverse(M1, m1);
    y2 = mod_inverse(M2, m2);

    % Calculate n
    n = mod(a1*M1*y1 + a2*M2*y2, m1*m2);

    % Add multiples of m1*m2 until we get a number greater than 100
    while (n <= 100)
        n = n + m1*m2;
    end

    return n;
end

result = smallest_planets();
disp(result);
```
