This problem can be solved programmatically using GNU Octave. We can use the prime factorization of 144 to find the possible pairs of integers whose product is 144. Then, we can calculate the least common multiple (LCM) and the greatest common divisor (GCD) for each pair and check if the ratio of LCM to GCD is 9. If it is, we add the two integers in the pair to find the sum.

Here is the Octave code to solve the problem:

```octave
function sum_of_integers
  % Factorize 144
  factors = factor(144);

  % Initialize the sum of integers
  sum_of_integers = 0;

  % Iterate over the factors
  for i = 1:numel(factors)
    for j = i:numel(factors)
      % Calculate the product of the factors
      product = factors(i) * factors(j);

      % Check if the product is 144
      if product == 144
        % Calculate the LCM and GCD
        lcm = lcm(factors(i), factors(j));
        gcd = gcd(factors(i), factors(j));

        % Check if the ratio of LCM to GCD is 9
        if lcm / gcd == 9
          % Add the two integers
          sum_of_integers = factors(i) + factors(j);
          break;
        end
      end
    end
  end

  % Print the sum of integers
  disp(sum_of_integers);
end

sum_of_integers()
```

