The equation of the circle is $x^2 + y^2 = 1994^2$. The slope of the line connecting the center of the circle $(0,0)$ and the point $(2 \cdot 1994, 2 \cdot 1994)$ is $\frac{2 \cdot 1994 - 0}{2 \cdot 1994 - 0} = 1$. The slope of the tangent line at the point of tangency $(a,b)$ is the negative reciprocal of the slope of the line connecting the center of the circle and the point $(2 \cdot 1994, 2 \cdot 1994)$, which is $-1$. Therefore, the equation of the tangent line is $y - b = -1(x - a)$.

We can set up a system of equations to solve for $a$ and $b$:

