First, we need to find out the number of pies that contain each ingredient. 

A third of the pies contain chocolate, so the number of chocolate pies is 3 * 12 / 3 = 12 pies.
A quarter of the pies contain marshmallows, so the number of marshmallow pies is 3 * 12 / 4 = 9 pies.
A sixth of the pies contain cayenne, so the number of cayenne pies is 3 * 12 / 6 = 6 pies.
A twelfth of the pies contain salted soy nuts, so the number of salted soy nut pies is 3 * 12 / 12 = 3 pies.

The total number of pies that contain at least one of these ingredients is 12 + 9 + 6 + 3 = 30 pies.

Since there are 3 * 12 = 36 pies in total, the number of pies that have none of these ingredients is 36 - 30 = 6 pies.

So, the smallest possible number of pies that had none of these ingredients is 6 pies.

Here is the GNU Octave code to solve this problem:

```octave
function pies_without_ingredients
  total_pies = 3 * 12;
  chocolate_pies = 3 * 12 / 3;
  marshmallow_pies = 3 * 12 / 4;
  cayenne_pies = 3 * 12 / 6;
  salted_soy_nut_pies = 3 * 12 / 12;

  pies_with_ingredients = chocolate_pies + marshmallow_pies + cayenne_pies + salted_soy_nut_pies;

  pies_without_ingredients = total_pies - pies_with_ingredients;

  return pies_without_ingredients;
end

result = pies_without_ingredients();
