First, we need to calculate the total number of minutes Kendra shoots hoops in a week. Since she shoots hoops for 30 minutes every day for one week, the total number of minutes is 30 minutes/day * 7 days/week = 210 minutes/week.

Next, we know that shooting hoops for 30 minutes burns 150 calories. Therefore, the number of calories Kendra burns in a week is 150 calories/30 minutes * 210 minutes = 1050 calories.

We can solve this problem using GNU Octave as follows:

```octave
function calories_burned
    minutes_per_day = 30;
    days_per_week = 7;
    calories_per_minute = 150 / 30;

    total_minutes = minutes_per_day * days_per_week;
    total_calories = calories_per_minute * total_minutes;

    return total_calories;
end

result = calories_burned()
```
```output
1050
```
So, Kendra would burn $\boxed{1050}$ calories if she shot hoops 30 minutes every day for one week.

This problem can be solved programmatically using GNU Octave. The problem involves finding the number of solutions in x of the congruence $64x\equiv 2\pmod {66}$ such that $0< x\le 100$. We can use the Octave's `sym` function to represent the variables and the `solve` function to find the solutions.

Here's a sample Octave code to solve the problem:

```octave
function solve_congruence
  x = sym('x');
  congruence = mod(64*x, 66) - 2;
  solutions = solve(congruence, x);

  # Filter solutions that are in the range (0, 100]
  solutions = solutions(solutions > 0 & solutions <= 100);

  # Return the number of solutions
  return length(solutions);
end

result = solve_congruence();
disp(result);
```

This code will output the number of solutions in x of the congruence $64x\equiv 2\pmod {66}$ such that $0< x\le 100$.

