function probability = calculate_probability()
    total_count = 100000;
    satisfied_count = 0;

    for i = 1:total_count
        # Generate random arrival times for Alice and Bob
        alice_arrival = 5 + rand();
        bob_arrival = 5 + rand();

        # Calculate the number of minutes Alice is late and the number of minutes Bob is late
        alice_late = (6 - alice_arrival) * 60;
        bob_late = (6 - bob_arrival) * 60;

        # Check if the sum of the lateness is less than 45
        if alice_late + bob_late < 45
            satisfied_count = satisfied_count + 1;
        end
    end

    # Calculate the probability
    probability = satisfied_count / total_count;
end

probability = calculate_probability();
disp(probability);
```
