This problem can be solved using the combination formula in mathematics. The combination formula is given by:

C(n, k) = n! / (k!(n-k)!)

where n is the total number of items, k is the number of items to choose, and ! denotes the factorial function.

In this case, n = 20 (total number of balls) and k = 2 (number of balls to choose).

So, we can use the combination formula to calculate the number of ways to select 2 balls from 20.

```octave
function ways = calculate_ways()
  n = 20;
  k = 2;

  ways = factorial(n) / (factorial(k) * factorial(n - k));
end

result = calculate_ways();
disp(result);
```
